export async function getMembersCount() {
    try {
      const response = await fetch(
        'http://localhost:2323/api/members'
      );
      const json = await response.json();
      const membersCounter=JSON.stringify(json);
      return membersCounter;
    } catch (error) {
      console.error(error);
    }
  };
